import { Stage, Layer, Rect, Circle } from "react-konva";

export default function Portrait(){
    return (
        <Stage width={window.innerWidth} height={window.innerHeight}
        onpoitee>
          <Layer>
            {/* Draw a Rectangle */}
            <Rect
              x={20}
              y={50}
              width={100}
              height={100}
              fill="red"
              shadowBlur={10}
              draggable
            />
            {/* Draw a Circle */}
            <Circle
              x={200}
              y={150}
              radius={50}
              fill="blue"
              shadowBlur={10}
              draggable
            />
          </Layer>
        </Stage>
      );
}
